        // 向 WebSocket 服务端发送消息
        $str = $croom->serializeToString();
        $client->push($str, WEBSOCKET_OPCODE_BINARY);
        // 获取服务端响应的消息，服务端需要通过 push 向本客户端的 fd 投递消息，才能获取；以下设置超时时间 2s，接收到的数据类型为 Frame 对象。
        /* @var Frame $msg */
        $skMsg = new SocketMessage();
//        defer($this->keepHeartBeat($client));
        co(function () use ($client) {
            $this->keepHeartBeat($client);
        });
        defer(function () use ($client, $skMsg) {
            while (true) {
                $msg = $client->recv();
                if (! isset($msg->data)) {
                    return;
                }

                $skMsg->mergeFromString($msg->data);
                if ($skMsg->getPayloadType() == PayloadType::SC_FEED_PUSH) {
                    $this->feed($skMsg->getPayload());
                    continue;
                }
                Coroutine::sleep(0.1);
            }
        });
    }

    public function keepHeartBeat(Client $client)
    {
        $obj = new CSWebHeartbeat();
        $obj->setPayloadType(1);
        $paylod = new CSWebHeartbeat\Payload();
        // 这里可以使用协程上下文做标记
        while (true) {
            $paylod->setTimestamp(time() * 1000);
            $obj->setPayload($paylod);
            $str = $obj->serializeToString();
            $client->push($str, WEBSOCKET_OPCODE_BINARY);
            var_dump(1);
            Coroutine::sleep(10);
        }
    }

